import "./App.css";
import Hero from "./components/Hero";
import Navbar from "./components/Navbar";
import MyWork from "./components/MyWork";
import Footer from "./components/Footer";
import ContactForm from "./components/ContactForm";

function App() {
  return (
    <>
      <Navbar />
      <Hero />
      <MyWork />
      ContactForm
      <Footer />
    </>
  );
}

export default App;
